import {Icon} from 'react-native-elements';

const AddIcon = () => {
  return (
    <Icon name={'add_circle_outline'}/>
  )
};

const RemoveIcon = () => {
  <Icon name={'remove_circle_outline'}/>
};

export default {RemoveIcon, AddIcon};
